function round(m,f,j){var i,n,l,k;f|=0;i=Math.pow(10,f);m*=i;k=(m>0)|-(m<0);l=m%1===0.5*k;n=Math.floor(m);if(l){switch(j){case"2":case"PHP_ROUND_HALF_DOWN":m=n+(k<0);break;case"3":case"PHP_ROUND_HALF_EVEN":m=n+(n%2*k);break;case"4":case"PHP_ROUND_HALF_ODD":m=n+!(n%2);break;default:m=n+(k>0)}}return(l?m:Math.round(m))/i};